import { useSelector } from "react-redux";

function Cart() {
  // const cart = useSelector((state) => state.cart.cartList);
  const cart = localStorage.getItem("cart").split(" ");
  let cartdata = [];
  cart.forEach((c) => {
    cartdata.push({ id: c });
  });
  console.log(cartdata);
  fetch("http://localhost:8080/cartData", {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
      cart: cartdata,
    }),
  })
    .then((res) => {
      return res.json();
    })
    .then((data) => {
      console.log(data);
    });
  return (
    <div>
      Here is your cart
      {cart.map((c) => {
        return (
          <div>
            {c[0]}
            {c[1]}
          </div>
        );
      })}
    </div>
  );
}

export default Cart;
